import React from "react";
import { View, Text } from "react-native";
import { Divider } from "react-native-paper";

function BottomTabs(props) {
  return (
    <View>
      <Text>BOTTOM</Text>
      <Divider width={1} />
    </View>
  );
}

export default BottomTabs;
